import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { Toaster } from 'react-hot-toast';
import { AuthProvider, useAuth } from './contexts/AuthContext';
import Login from './pages/Login';
import AdminDashboard from './pages/admin/AdminDashboard';
import ClientDashboard from './pages/client/ClientDashboard';
import ClientManagement from './pages/admin/ClientManagement';
import KeywordManagement from './pages/admin/KeywordManagement';
import ScanManagement from './pages/admin/ScanManagement';
import ReportManagement from './pages/admin/ReportManagement';
import ClientReports from './pages/client/ClientReports';
import LoadingSpinner from './components/LoadingSpinner';
import DebugInfo from './components/DebugInfo';
import TestPage from './pages/TestPage';
import ModernLayout from './components/ModernLayout';

// Protected Route Component
const ProtectedRoute = ({ children, requiredRole }) => {
  const { user, loading } = useAuth();

  if (loading) {
    return <LoadingSpinner />;
  }

  if (!user) {
    return <Navigate to="/login" replace />;
  }

  if (requiredRole && user.role !== requiredRole) {
    return <Navigate to="/" replace />;
  }

  return children;
};

// Main App Component
const AppContent = () => {
  const { user, loading } = useAuth();

  if (loading) {
    return <LoadingSpinner />;
  }

  return (
    <Routes>
      <Route path="/login" element={!user ? <Login /> : <Navigate to="/" replace />} />

      {/* Admin Routes */}
      <Route path="/admin" element={
        <ProtectedRoute requiredRole="admin">
          <ModernLayout isAdmin={true}>
            <AdminDashboard />
          </ModernLayout>
        </ProtectedRoute>
      } />

      <Route path="/admin/clients" element={
        <ProtectedRoute requiredRole="admin">
          <ModernLayout isAdmin={true}>
            <ClientManagement />
          </ModernLayout>
        </ProtectedRoute>
      } />

      <Route path="/admin/keywords" element={
        <ProtectedRoute requiredRole="admin">
          <ModernLayout isAdmin={true}>
            <KeywordManagement />
          </ModernLayout>
        </ProtectedRoute>
      } />

      <Route path="/admin/scans" element={
        <ProtectedRoute requiredRole="admin">
          <ModernLayout isAdmin={true}>
            <ScanManagement />
          </ModernLayout>
        </ProtectedRoute>
      } />

      <Route path="/admin/reports" element={
        <ProtectedRoute requiredRole="admin">
          <ModernLayout isAdmin={true}>
            <ReportManagement />
          </ModernLayout>
        </ProtectedRoute>
      } />

      {/* Client Routes */}
      <Route path="/" element={
        <ProtectedRoute>
          {user?.role === 'admin' ? <Navigate to="/admin" replace /> : <ClientDashboard />}
        </ProtectedRoute>
      } />

      <Route path="/reports" element={
        <ProtectedRoute requiredRole="client">
          <ClientReports />
        </ProtectedRoute>
      } />

      {/* Test route */}
      <Route path="/test" element={<TestPage />} />

      {/* Default redirect */}
      <Route path="*" element={<Navigate to="/" replace />} />
    </Routes>
  );
};

// Main App
function App() {
  return (
    <AuthProvider>
      <Router future={{ v7_startTransition: true, v7_relativeSplatPath: true }}>
        <div className="App">
          <DebugInfo />
          <AppContent />
          <Toaster
            position="top-right"
            toastOptions={{
              duration: 4000,
              style: {
                background: '#363636',
                color: '#fff',
              },
              success: {
                duration: 3000,
                iconTheme: {
                  primary: '#10b981',
                  secondary: '#fff',
                },
              },
              error: {
                duration: 5000,
                iconTheme: {
                  primary: '#ef4444',
                  secondary: '#fff',
                },
              },
            }}
          />
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
